    { id: 8, name: 'Craig', phone_number: '824 849 8258' },
    { id: 9, name: 'Ben', phone_number: '274 822 0717' },
]

const [slots, setSlots] = useState(availabilityData)


return (
    <div>
        <Layout>
        <h1>It's CRUD time!</h1>
        <div>
          <h2>View time slots</h2>
          <TimeTable slots={slots} />
        </div>
        </Layout>
    </div>
  );
}

export default Index;
